import styled from 'styled-components';

const CarouselStyles = styled.div`
  position: relative;
  background-color: #f7f7f7;
  padding: 20px;
  max-width: 670px;
  margin-left: auto;
  margin-right: auto;


`;

export default CarouselStyles;
